import {callApi} from './commons/axiosService';
export const getData=()=>{
    return (dispatch)=>{
       callApi();
       dispatch(this.props.actFetchProducrs())
    }
}
export const  actFetchProducrs=(products)=>{
    return{
        type:'FETCH-PRODUCTS',
        products:products
    }
}
